import React from 'react';
import './App.css';
import YouTube from './Youtube';
import yt from 'Youtube';

function App() {
    console.clear();
    return (
        <div className="App">
            <header>
                <p>YouTube Demo</p>
                <input></input>
                <button>Search</button>
            </header>
        <YouTube />
        </div>
    );
}

export default App;
